import React from 'react';
import { NavigationContainer } from '@react-navigation/native'
import {createBottomTabNavigator} from '@react-navigation/stack'

import prod from 'C:/Users/Rodrigo/Desktop/OFTRANCE/app-of-trance/src/telas/Home/componentes/produtos.js'
import index from 'C:/Users/Rodrigo/Desktop/OFTRANCE/app-of-trance/src/telas/Home/index.js'

const Stak = createBottomTabNavigator();

export default function Routes() {
    return(
        <NavigationContainer>
        <Stack.Navigator>
            <Stack.Screen name='index' component={index} options={{headerShown: false}} />
            <Stack.Screen name='prod' component={prod} options={{headerShown: false}} />
        </Stack.Navigator>
        </NavigationContainer>
    )
}
